Defendant Oumalay J Saypanya in court, in custody, with attorney M. Elizabeth Weathers.   Melissa Zilavy appeared for the State of Wisconsin.

Plea Colloquy.

Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  Count 2 is dismissed and read in.

The Court Orders the Following:

Imposed and Stayed Sentence of:

5 years Imprisonment 
- 2 years of Initial Confinement
- 3 years of Extended Supervision

Term of Probation: 3 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Random U.A.s;
- No Use or Possession of  illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Follow through with any treatment and/or counseling recommended by Agent;
- Maintain/Obtain full time employment and or schooling;
- No contact with  Northfield Senior Living and Clarence H.;
- Provide DNA sample if not yet provided  and pay surcharge.

Restitution: $662.00 ($503.00 to Clarence H. and $159.00 to Visa Credit Card)  

Costs: $278.00
DNA Surcharge:  $250.00
DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

Condition Time: 10 months (First 2 months Straight Time remaining Huber with  NON WORKING HOURS WITH STANDARD RELEASE CONDITIONS).  Credit given for 29 days to apply to the straight time

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
